import React from "react";
import LogIn from "./LogIn";
import image from "./Images/DogCat.jpeg";

function Home() {
  return (
    <div className="pageCard row justify-content-center">
      <div className="pb-2 col-12 col-md-6 order-md-2">
        <h2 className="titleFont">Pet</h2>
        <h2 className="titleFont">Friend.ly</h2>

        <div className="bg-dark mw-100">
          <LogIn></LogIn>
        </div>
      </div>
      <div className="pb-2 col-12 col-md-6 order-md-1">
        <img src={image} alt=""></img>
      </div>
    </div>
  );
}

export default Home;
